(230, 'A91', 'Grado centesimal', 'Sinónimo: grado\nEl grado centesimal o gon —también llamado gradián (plural: gradianes) y gonio — es una unidad de medida de ángulos planos, alternativa al grado sexagesimal y al radián.', 1),
