(1767, 'P27', 'Vela (medida)', 'Es una unidad de medida de iluminancia que no pertenece al Sistema Internacional de Unidades, pero es ampliamente usada en Estados Unidos para fotografía, cine, televisión, conservación luminosa, ingeniería de la construcción, etc. Una vela significa \"el reparto de iluminación sobre una superficie equivalente a una candela, y a un pie de distancia\".', 1),
